import './App.css';
import { reduxForm, Field } from 'redux-form';

function App(props){
  console.log(props);
  const {handleSubmit}=props;
    return (
      <div className="App">
        <form onSubmit={handleSubmit((formValues)=>alert("Submited Data: "+formValues['first']+" "+formValues['second']))}>
          <label>First Name</label>
          <Field type="text" name="first_name" component="input"></Field><br/>
          <label>Last Name</label>
          <Field type="text" name="last_name" component="input"></Field><br/>
          <label>Email Id</label>
          <Field type="email" name="email" component="input"></Field><br/>
          <label>Mobile No</label>
          <Field type="number" name="mobile" component="input"></Field><br/>
          <label>How did you hear about us?</label>
          <Field type="text" name="mobile" component="select"></Field><br/>
          <button type="submit">SubmitMe</button>
        </form>
      </div>
    );
}
let Application = reduxForm({
  // a unique name for the form
  form: 'myForm'
})(App)
export default Application;
